import React from "react";

function About() {
  return (
    <section class="section">
    <div class="container">
        <h1 class = "has-text-centered">About</h1>
        <br></br>
        <p class="subtitle is-5">TwinsMusic Enterprises Corporation is a global musical artist management company built on bringing cultural experiences to large and diverse audiences. TwinsMusic organizes music events such as concerts, festivals, and, tours for jazz and gospel artists in the US and Europe. The TwinsMusic team works closely with clients on artist management and working to achieve their professional goals. TwinsMusic also works with artists on releasing and distributing publications and records worldwide. TwinsMusic organizes workshops and seminars in the US, Europe, and China in collaboration with NYC jazz workshops. Stevie Wonder, Miriam Makeba, The Manhattan Transfer, Elvin Jones Jazz Machines, Ray Charles, Robert Plant, Chick Corea, Micheal Petrucciani, The Jazz At Lincoln Center Orchestra with Wynton Marsalis, Monty Alexander, Freddie Hubbard, Benny Golson, Freddy Cole, Regina Carter, and Ravi Coltrane are some of the great artists that TwinsMusic has presented internationally in the last 25 years. Sala Nervi in Vatican City, Rai, Mediaset, Teatro Regio di Parma, Carnegie Hall, Lincoln Center, Arena di Verona, Orsara Musica, La Spezia International Jazz Festival, Ravenna Jazz Festival, Ancona Jazz, Ronnieâ€™s Scott,  are some of the institutions TwinsMusic served as artistic consultant/presenter.</p>
        <p class="subtitle is-5">TwinsMusic recently launched an exciting and innovative feature on our online store, MusMe. MusMe is our very own royalty-free music library,  it is an affordable subscription-based music library that features original music, sound bites, ringtones, and sounds effects. MusMe sets itself apart from other music libraries because all music in the library is acoustic original music. Each month, the MusMe team updates the library with refreshing new music and sounds so users will never run out of new content. Users can pay for yearly or monthly subscriptions through the <a class="custom-link" href="/about">TwinsMusic Store</a>.</p>
        <p class="subtitle is-5">We appreciate your business and hope you enjoy our exclusive MusMe Music Library!</p>
        <p class="subtitle is-5">If you are looking to license music for a commercial, film, radio, or tv show, please contact our sales representative at <a class="custom-link" href="mailto:giusymagri@twinsmusicny.info">giusymagri@twinsmusicny.info</a></p>
    </div>
    </section>

  );
}

export default About;
